function getColor_wind1(d) {
	                   
    return d >  56.1  ? '#880e4f' :
           d >  50.9  ? '#c62828' :
           d >  46.1  ? '#e64a19' :
           d >  41.4  ? '#fb8c00' :
           d >  36.9  ? '#ffc107' :
           d >  32.6  ? '#ffee58' :
					    '#dbffa5' ;
};	

function getColor_wind2(d) {
	                   
    return d >  36.9  ? '#880e4f' :
           d >  32.6  ? '#c62828' :
           d >  28.4  ? '#e64a19' :
           d >  24.4  ? '#fb8c00' :
           d >  20.7  ? '#ffc107' :
           d >  17.1  ? '#ffee58' :
					    '#dbffa5' ;
};	

