	    if (this.options.rank=="STS")     {   this.setStyle({ color:"#f9a825" })  };
	    if (this.options.rank=="TY")      {   this.setStyle({ color:"#ff8f00" })  };
	    if (this.options.rank=="STY")     {   this.setStyle({ color:"#ef6c00" })  };
